import React, { Component } from 'react';
import VerticalMenu from './menu/vertical-menu';
import { Route } from "react-router-dom";
import PositionAbsoulte from './page/position-absoulte';
import PositionMore from './page/position-more';
import './App.sass';

class App extends Component {
  render() {
    return (
      <div className="App">
        {/* <Button type="primary">Button</Button>
        <div className="demo">232342</div> */}
        <VerticalMenu />
        <div>
          <Route path="/absolute'" component={ PositionAbsoulte } />
          <Route path="/more" component={ PositionMore } />
        </div>
      </div>
    );
  }
}

export default App;
